import React from 'react'

class AddContact extends React.Component {
state={
  name:"",
  email:""
}

  render(){
    return (
      <div className='ui main'>
          <h2 style={{marginTop:'5%'}}>Add Contact</h2>
          <form className='ui form'>
              <div className="field">
                  <label>Name</label>
                  value={this.state.name}
                  <input type="text" name='name' placeholder='Enter Your Name' onChange={(e)=>{this.setState({name: e.target.value})}} />
              </div>
              <div className="field">
                  <label>Email</label>
                  value={this.state.name}
                  <input type="text" name='name' placeholder='Enter Your Email' onChange={(e)=>{this.setState({email: e.target.value})}} />
              </div>
              <button className='ui button blue'>Add Data</button>
  
          </form>
  
      </div>
    )

  }
  
}

export default AddContact
